    return ( <
        div className = "ma1 mto" >
        <
        Tilt className = "w-40" >
        <
        div className = "Tilt" >
        <
        img alt = "logo"
        src = { Brain }
        /> <
        /div> <
        /Tilt> <
        /div>
    );
}
export default Logo;
